import React, {useState} from 'react'
import { Menu } from 'antd';
import { HomeOutlined, AppstoreOutlined, DashboardOutlined,LoginOutlined,UserAddOutlined} from '@ant-design/icons';
import {Link} from 'react-router-dom';
const { SubMenu, Item } = Menu;

const Header = () => {
 const [current, setCurrent ] = useState("")


    const handleClick = (e) => {
      setCurrent(e.key);
 console.log(e.key);
    }
    return (
        <Menu onClick={handleClick} selectedKeys={[current]} mode="horizontal">
          <Item key="Homepage" icon={<HomeOutlined />}>
            <link to = "/Homepage"></link>Homepage
          </Item>
          <Item key="Registro" icon={<UserAddOutlined />} className= "float-right">
            <Link to ="/Registro"></Link>Registro
          </Item>
          <Item key="Login" icon={<LoginOutlined />} className= "float-right">
           <Link to ="/Login"></Link> Login
          </Item>
          <SubMenu key="SubMenu" icon={<DashboardOutlined /> } title="Registro">
              <Item key="setting:1">Option 1</Item>
              <Item key="setting:2">Option 2</Item>
          </SubMenu>
        </Menu>
      );
    }
  

export default Header;
